import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Vergiss nicht, BrowserRouter und Route zu importieren
import Navbar from './components/Navbar';
import Board from './components/Board';
import TaskManagement from './components/TaskManagement';
import TaskDetailsPopup from './components/TaskDetailsPopup';
import Task from './components/Task';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route exact path="/">
            <Board />
          </Route>
          <Route exact path="/tasks">
            <TaskManagement />
          </Route>
          <Route path="/tasks/:id">
            <TaskDetailsPopup />
          </Route>
          <Route path="/task/edit/:id">
            <Task />
          </Route>
          <Route path="/task/new">
            <Task />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
